contract Factory {
    address[] public newContracts;
    uint ETH;

    function createContract (bytes32 name) {
        address newContract = new Contract(name);
        newContracts.push(newContract);


    } 

    function getnewContracts() view returns (address[]) {
        return newContracts;
    }

    function depositEther() payable {
        ETH = ETH + msg.value;
    }

    function returnEther() view returns (uint) {
        return ETH;
    }


}

contract Contract {
    bytes32 public Name;

    function Contract (bytes32 name) {
        Name = name;
    }
}
